import Sidebar from './components/widgets/Sidebar';
import Header from './components/widgets/Header';


const App = () => {

  return (
    <div>
      <Router>
    <Sidebar />
    <div className = "main col-11">
    <Header />
    <Routes>
    <Route path="/data">
          <Data />
        </Route>
        <Route path="/">
          <Home />
        </Route>
    </Routes>
    </div>

     </Router>
    </div>
  )
}

export default App;
